Calculates the quotient of `self` and `rhs`, rounding the result towards positive infinity.

The result is guaranteed to be non-zero.

# Examples

```
# use std::num::NonZero;
assert_eq!(one.div_ceil(max), one);

assert_eq!(three.div_ceil(two), two);
```
